    --paletteColor1: #000;
    --paletteColor2: #fff;
    --paletteColor3: #3b8ef3;
    --paletteColor4: #f5f5f5;
    --paletteColor5: #313b3d;
    --paletteColor6: #cccccc;
    --paletteColor7: #363636;
    --paletteColor8: #e4e4e4;
    --paletteColor9: #656565;
    --paletteColor10: #f25a41;
    --paletteColor11: #136BD6;
}
","* {
    box-sizing: border-box;
    outline: 0;
}

html,
body {
    height: 100%;
}

body {
    background-color: var(--paletteColor2);

    font-family: roboto mono, roboto, system-ui;
    font-smoothing: antialiased;
    font-variant-ligatures: none;
    -moz-text-size-adjust: 100%;
    -webkit-text-size-adjust: 100%;
    -ms-text-size-adjust: 100%;

    min-height: 100vh;

    & section {
        width: 100%;
    }
}

#app {
    display: flex;
    flex-direction: column;
    min-height: 100%;

    & main {
        flex: 1 0 auto;
        z-index: 100;
    }

    & footer {
        flex: 0 0 auto;
    }
}

button.button {
    border: 1px solid #000;
    padding: 5px 12px;
    border-radius: 15px;
    cursor: pointer;
    &:hover {
        color: #fff;
        background-color: #000;
    }
    &:active,
    &:focus-within
    {
        outline: none;
        box-shadow: none;
    }
}
